import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from "./Home.js"
import React from "react"

function App() {
  return (
    <div className="App">
        //<NavBar />
        <Routes>
            <Route exact path="/Home" element={<Home/>} />
        </Routes>
    </div>
  );
}

export default App;
